import React from 'react';
import { Button, Table } from 'reactstrap';

const PaginaInicialFornecedores = () => {
    return(
        <>  
        <Table hover responsive autoCapitalize={'on'}>
            <thead>
            <div style={{
                    display: 'flex',
                    flexDirection: 'row',
                    alignItems: 'center',
                }}>
                    <button onClick={() => alert('Novas')} className={"p-2"} 
                    style={{position: 'relative', fontWeight: 'lighter', backgroundColor: 'beige', border: 0, borderRadius: 14}}>Novas</button>
                    <button onClick={() => alert('Dec li')} className={"p-2"} 
                    style={{position: 'relative', fontWeight: 'lighter', backgroundColor: 'transparent', border: 0}}>Respondidas</button>
                    <button onClick={() => alert('Não respondidas')} className={"p-2"} 
                    style={{fontWeight: 'lighter', backgroundColor: 'transparent', border: 0}}>Declinadas</button>
            </div>
                <tr>
                    <th>Código</th>
                    <th>Obra</th>
                    <th>Categorias</th>
                    <th>Solicitante</th>
                    <th>Solicitação</th>
                    <th>Encerramento</th>
                </tr>
            </thead>
            <tbody>

                <tr>
                    <td style={{
                        display: 'flex',
                        alignItems: 'center',
                    }}>
                        <i className={"ri-star-line mr-2"} style={{
                            color: "#d4d400"
                        }}/> 
                        Pessoa jurídica
                    </td>

                    <td>
                        São José da Coroa Grande
                        <i style={{marginLeft: 4, color: 'primary'}} className={"ri-map-pin-2-line"}/>
                    </td>
                    <td style={{display: 'flex', flexDirection: 'row', alignItems: 'center'}}>J43OIJ2 <i style={{marginLeft: 4, color: 'primary'}} className={"ri-file-list-line"}/></td>
                    <td>13/06/2021</td>
                    <td>50%</td>
                    <td>
                        <Button type={"button"} color="primary" style={{
                            height: 23,
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                        }}>
                            <i className={"ri-eye-line mr-2"}
                            />
                            {"Ver"}
                        </Button>
                    </td>
                    <td>Teste</td>
                </tr>
            </tbody>
            </Table>  
        </>
    )
}

export default PaginaInicialFornecedores;
